import React, { useState, useEffect } from 'react';
import axios from 'axios';

const API_URL = 'http://localhost:5103/api/ToDoList'; // API URL'ini burada tutuyoruz

const YapilacaklarListesi = () => {
    const [gorev, setGorev] = useState('');
    const [gorevler, setGorevler] = useState([]);
    const [tamamlananGorevler, setTamamlananGorevler] = useState([]);

    // Sayfa yüklendiğinde görevleri almak için
    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get(API_URL);
                setGorevler(response.data); // API'den gelen veriyi state'e set et
            } catch (error) {
                console.error('Görevler alınırken hata:', error);
            }
        };
        fetchData();
    }, []);

    // Yeni görev ekleme işlemi
    const gorevEkle = async () => {
        if (gorev.trim() !== '') {
            try {
                const response = await axios.post(API_URL, {
                    Name: gorev,
                    IsCompleted: false,
                    CreatedAt: new Date().toISOString(),
                });
                console.log('Görev Eklendi:', response.data); // Hata kontrolü için log ekledik
                // Yeni görevi mevcut gorevler listesine ekleyin
                setGorevler(prevGorevler => [...prevGorevler, response.data]);
                setGorev(''); // Input'u temizle
            } catch (error) {
                console.error('Görev ekleme hatası:', error.response?.data || error.message);
            }
        } else {
            console.log('Görev ismi boş!'); // Hata mesajı ekledik
        }
    };

    // Görev tamamlandı olarak işaretleme işlemi
    const tamamlandi = async (id) => {
        try {
            const tamamlanan = gorevler.find(g => g.id === id);
            if (tamamlanan) {
                await axios.put(`${API_URL}/${id}`, { ...tamamlanan, IsCompleted: true });
                // Tamamlanan görevi tamamlanan listesine ekleyin
                setTamamlananGorevler(prev => [...prev, tamamlanan]);
                // Aktif görevler listesinden çıkarın
                setGorevler(prev => prev.filter(g => g.id !== id));
            }
        } catch (error) {
            console.error('Tamamlandı olarak işaretleme hatası:', error.response?.data || error.message);
        }
    };

    // Görev silme işlemi
    const gorevSil = async (id) => {
        try {
            await axios.delete(`${API_URL}/${id}`);
            // Görevi her iki listeden de silin
            setGorevler(prev => prev.filter(g => g.id !== id));
            setTamamlananGorevler(prev => prev.filter(g => g.id !== id));
        } catch (error) {
            console.error('Silme hatası:', error.response?.data || error.message);
        }
    };

    return (
        <div>
            <h2>Yapılacaklar Listesi</h2>
            <div>
                <input
                    type="text"
                    value={gorev}
                    onChange={(event) => setGorev(event.target.value)} // Text input'u ile görev adını ayarla
                    placeholder="Yeni görev"
                />
                <button onClick={gorevEkle}>Ekle</button>
            </div>
            <div>
                <h3>Aktif Görevler</h3>
                <ul>
                    {gorevler.length > 0 ? (
                        gorevler.map(g => (
                            <li key={g.id}>
                                {g.Name}
                                <button onClick={() => tamamlandi(g.id)}>Tamamlandı</button>
                                <button onClick={() => gorevSil(g.id)}>Sil</button>
                            </li>
                        ))
                    ) : (
                        <p>Aktif görev bulunmamaktadır.</p>
                    )}
                </ul>
            </div>
            <div>
                <h3>Tamamlanan Görevler</h3>
                <ul>
                    {tamamlananGorevler.length > 0 ? (
                        tamamlananGorevler.map(g => (
                            <li key={g.id}>
                                <del>{g.Name}</del>
                                <button onClick={() => gorevSil(g.id)}>Sil</button>
                            </li>
                        ))
                    ) : (
                        <p>Henüz tamamlanan görev bulunmamaktadır.</p>
                    )}
                </ul>
            </div>
        </div>
    );
};

export default YapilacaklarListesi;
